import { shortenUrl } from "./services/api";
import { useEffect } from "react";

function App() {
  useEffect(() => {
    const shorten = async () => {
      const shortUrl = await shortenUrl("https://www.google.com");
      console.log(shortUrl);
    };

    shorten();
  }, []);

  return <div className="App">Hello, world!</div>;
}

export default App;
